const d = 27;
const q = 109103;

/**
 *
 * @param {number} b
 * @param {number} p
 * @param {number} q
 * @returns {number}
 */
const fastModPower = (b, p, q) => {
	let mask = 1 << (Math.log2(p) - 1);
	let res = b;

	while (mask > 0) {
		const bit = mask & p;
		res = res ** 2 % q;
		if (bit) res = (res * b) % q;
		mask = mask >> 1;
	}

	return res;
};

/**
 * @param {string} str
 * @returns {number}
 */
const hash = (str) => {
	const { val } = str
		.split('')
		.reverse()
		.reduce(
			({ val, pow }, el) => ({
				val:
					(val + (el.charCodeAt(0) - 'a'.charCodeAt(0) + 1) * pow) %
					q,
				pow: (pow * d) % q,
			}),
			{ val: 0, pow: 1 }
		);

	return val;
};

/**
 * @param {number} currentHashVal
 * @param {string} added
 * @returns {number}
 */
const addLast = (currentHashVal, added) =>
	(currentHashVal * fastModPower(d, added.length, q) + hash(added)) % q;

/**
 *
 * @param {string} s
 * @returns {[string,number][]}
 */
const getAllPrefixes = (s) => {
	const prefixes = [];
	let c = '';
	let hash = 0;
	for (let i = 0; i < s.length; i++) {
		c += s[i];
		hash = addLast(hash, s[i]);
		prefixes.push([c, hash]);
	}

	return prefixes;
};

/**
 * @param {string} s
 * @return {string}
 */
const longestPrefix = (s) => {
	const prefixes = getAllPrefixes(s);
	const prefixesMap = prefixes.reduce(
		(p, c) => Object.assign(p, { [c[1]]: (p[c[1]] || []).concat(c[0]) }),
		{}
	);
	let [str, val] = prefixes[prefixes.length - 1];
	let pow = fastModPower(d, s.length - 1, q);

	for (let i = 0; i < prefixes.length - 1; i++) {
		const currHash = val - ((prefixes[i][1] * pow) % q);
		const _hash = currHash > 0 ? currHash : q + currHash;

		if (prefixesMap[_hash]) {
			const strings = prefixesMap[_hash];
			const act = str.substring(i + 1);
			for (let j of strings) {
				if (act === j) return act;
			}
		}
		pow = (pow * 28286) % q;
	}

	return '';
};

